export default function Contact() {
  return (
    <section id="contact" className="py-16 px-6 text-center">
      <h2 className="text-2xl font-bold mb-4">Contact Me</h2>
      <form className="flex flex-col gap-3 max-w-md mx-auto">
        <input type="text" placeholder="Your Name" className="p-2 border rounded"/>
        <input type="email" placeholder="Your Email" className="p-2 border rounded"/>
        <textarea placeholder="Your Message" className="p-2 border rounded"></textarea>
        <button type="submit" className="bg-yellow-500 text-white px-4 py-2 rounded shadow hover:bg-yellow-600">
          Send
        </button>
      </form>
      <p className="mt-4">Or email me at <a href="mailto:youremail@example.com" className="text-yellow-500">yashasvi.khatri.com</a></p>
    </section>
  );
}
